    false,nt"url": null,nt"notes": "The purpose of this report is to analyze
    the water budget and water quality for West Knox Pond for the May through September
    period of 2002 and 2003. The determination of the water budget will allow us to
    calculate nutrient loads and evaluate downstream water quality impacts, as well
    as estimate water lost through evapotranspiration (ET). Evapotranspiration rates
    estimated using the water balance approach will allow a comparative assessment of
    alternative modeled estimates of ET using readily available meteorological data.",nt"license_title":
